def encode(message):
    vowels = "aeiouAEIOU"
    encoded_message = ""

    for char in message:
        if char.isalpha():
            if char.lower() in vowels:
                encoded_char = chr((ord(char) + 2 - ord('a')) % 26 + ord('A') if char.isupper() else (ord(char) + 2 - ord('a')) % 26 + ord('a')
            else:
                encoded_char = char.swapcase()
        else:
            encoded_char = char

        encoded_message += encoded_char

    return encoded_message

