def find_planets_between(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]

    if planet1 not in planets or planet2 not in planets:
        return ()

    start_idx = planets.index(min(planet1, planet2)) + 1
    end_idx = planets.index(max(planet1, planet2))

    return tuple(planets[start_idx:end_idx]) if start_idx < end_idx else ()

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    if is_prime(n):
        return x
    else:
        return y

