def solve(s):
    letters = [c for c in s if c.isalpha()]
    if not letters:
        return s[::-1]

    reversed_s = ""
    for c in s:
        if c.isalpha():
            if c.islower():
                reversed_s += c.upper()
            else:
                reversed_s += c.lower()
        else:
            reversed_s += c

    return reversed_s

